import React from 'react';
import "semantic-ui-css/semantic.min.css";

import { Header, Table, Grid, Checkbox, Button, Icon } from "semantic-ui-react";

class App extends React.Component {
  render() {
    return (
      // <Table celled definition>
      //   <Table.Header>
      //     <Table.Row>
      //       <Table.HeaderCell rowSpan='4'/>
      //       <Table.HeaderCell colSpan='3'>Month</Table.HeaderCell>
      //     </Table.Row>
      //     <Table.Row>
      //       <Table.HeaderCell colSpan='3'>Amounts</Table.HeaderCell>
      //     </Table.Row>
      //     <Table.Row>
      //       <Table.HeaderCell colSpan='3'>Overbudgeted</Table.HeaderCell>
      //     </Table.Row>
      //     <Table.Row>
      //       <Table.HeaderCell>Budgeted</Table.HeaderCell>
      //       <Table.HeaderCell>Spent</Table.HeaderCell>
      //       <Table.HeaderCell>Balance</Table.HeaderCell>
      //     </Table.Row>
      //   </Table.Header>
      //   <Table.Body>
      //     <Table.Row>
      //       <Table.Cell>Groceries</Table.Cell>
      //       <Table.Cell>200</Table.Cell>
      //       <Table.Cell>-57.68</Table.Cell>
      //       <Table.Cell>142.32</Table.Cell>
      //     </Table.Row>
      //   </Table.Body>
      // </Table>
      <Grid>
        <Grid.Column>
  <Table compact celled definition>
  <Table.Header>
    <Table.Row>
      <Table.HeaderCell />
      <Table.HeaderCell>Name</Table.HeaderCell>
      <Table.HeaderCell>Registration Date</Table.HeaderCell>
      <Table.HeaderCell>E-mail address</Table.HeaderCell>
      <Table.HeaderCell>Premium Plan</Table.HeaderCell>
    </Table.Row>
  </Table.Header>

  <Table.Body>
    <Table.Row>
      <Table.Cell collapsing>
        <Checkbox slider />
      </Table.Cell>
      <Table.Cell>John Lilki</Table.Cell>
      <Table.Cell>September 14, 2013</Table.Cell>
      <Table.Cell>jhlilk22@yahoo.com</Table.Cell>
      <Table.Cell>No</Table.Cell>
    </Table.Row>
    <Table.Row>
      <Table.Cell collapsing>
        <Checkbox slider />
      </Table.Cell>
      <Table.Cell>Jamie Harington</Table.Cell>
      <Table.Cell>January 11, 2014</Table.Cell>
      <Table.Cell>jamieharingonton@yahoo.com</Table.Cell>
      <Table.Cell>Yes</Table.Cell>
    </Table.Row>
    <Table.Row>
      <Table.Cell collapsing>
        <Checkbox slider />
      </Table.Cell>
      <Table.Cell>Jill Lewis</Table.Cell>
      <Table.Cell>May 11, 2014</Table.Cell>
      <Table.Cell>jilsewris22@yahoo.com</Table.Cell>
      <Table.Cell>Yes</Table.Cell>
    </Table.Row>
  </Table.Body>

  <Table.Footer fullWidth>
    <Table.Row>
      <Table.HeaderCell />
      <Table.HeaderCell colSpan='4'>
        <Button floated='right' icon labelPosition='left' primary size='small'>
          <Icon name='user' /> Add User
        </Button>
        <Button size='small'>Approve</Button>
        <Button disabled size='small'>
          Approve All
        </Button>
      </Table.HeaderCell>
    </Table.Row>
  </Table.Footer>
</Table>
</Grid.Column>
</Grid>
    );
  }
}

export default App;
